“Wrap me up because I am gift”
-
Did you know today is #givingtuesday? It’s the biggest day of the year to give back to non-profits! Many places are matching donations, or inspiring others to give today. While we’re not all in a position to give, if you are, consider giving back to your favorite non-profit today! Here are a few of our favorites below!
